import React from "react";

type PropsType = {
  children: React.ReactNode;
};
function Layout(props: PropsType) {
  const { children } = props;

  return (
    <>
      <nav>I am nav</nav>

      <main>{children}</main>

      <footer>I am footer</footer>
    </>
  );
}

export default Layout;
